import './cart-icon.scss';
import {ReactComponent as CartSymbol} from '../../assets/cart.svg';

const CartIcon = () => {
  return(
    <div className='cart-icon'>
      <CartSymbol className='cart-symbol'/>
      <span className='item-count'>0</span>
    </div>
  )
}

export default CartIcon;
